('2420','18','7932','Kim',Null,' Moderne Villa mit fantastischem Meerblick in Puerto de Andratx','33980','Die moderne Villa in Hanglage wurde in der Cala Llamp bei Puerto de Andratx im minimalistischen Bauhaus-Stil errichtet. Die Luxusvilla bietet einen atemberaubenden und vor allem unverbaubaren Panorama- und Meerblick. Auf einer Wohnfläche von 372 m² bietet diese traumhafte Villa insgesamt 4 Schlafzimmer und fünf Bäder der Superlative. Die Neubauvilla wurde ausschließlich mit hochwertigsten Materialen in bester Qualität erbaut und ausgestattet. Sie verfügt über einen großzügigen Wohn- und Essbereich mit riesigen Panoramafenstern einen traumhaften Blick auf das Meer. Garage für zwei Fahrzeuge und ein Aufzug sind ebenso vorhanden und runden das Angebot ab','33981','3940000','106','2016-01-27 12:08:51','106','2016-01-27 12:09:42',Null,'2553','166','1099',1,'1','0',Null,Null,Null,'33982',Null,'0','0','0',Null,'2016-01-27 12:15:01',1,'0',Null,Null,Null,Null,'5',1,1,1,'1','1','1',1,1,Null,'33983',Null,'33984',Null,'33985',Null,'33986','+34 687 50 26 77  Kim   www.pinacolada.dk','33987','0',0,'3');
